      get 'index'
      expect(response.status).to eq(400)
      expect(JSON.parse(response.body)["errors"]).to eq(["sensor_id can't be blank", "sensor_id is not a number"])
    end

    it 'should say that sensor_id is invalid' do
      params = {sensor_id: "qwe"}
      get 'index', params
      expect(response.status).to eq(400)
      expect(JSON.parse(response.body)["errors"]).to eq(["sensor_id is not a number"])
    end

    it 'should say that sensor_id is invalid' do
      params = {sensor_id: -1}
      get 'index', params
      expect(response.status).to eq(400)
      expect(JSON.parse(response.body)["errors"]).to eq(["sensor_id must be greater than 0"])
    end

    it 'should say that sensor_id is invalid' do
      params = {sensor_id: 1.1}
      get 'index', params
      expect(response.status).to eq(400)
      expect(JSON.parse(response.body)["errors"]).to eq(["sensor_id must be an integer"])
    end

    it 'should say that start_time is invalid' do
      params = @valid_params_with_sensor_id
      params[:start_time] = "qwe"
      get 'index', params
      expect(response.status).to eq(400)
      expect(JSON.parse(response.body)["errors"]).to eq(["start_time is invalid"])
    end

    it 'should say that end_time is invalid' do
      params = @valid_params_with_sensor_id
      params[:end_time] = "qwe"
      params[:start_time] = nil
      get 'index', params
      expect(response.status).to eq(400)
      expect(JSON.parse(response.body)["errors"]).to eq(["end_time is invalid"])
    end

    it 'should return all data only with start_time' do
      params = @valid_params_with_sensor_id
      params[:start_time] = DateTime.now - 50.years
      params[:end_time] = nil
      get 'index', params
      # raise params.inspect
      # raise response.body.inspect
      expect(response.status).to eq(200)
      expect(JSON.parse(response.body)["data"].length).to eq(22)
    end

    it 'should return all data only with end_time' do
      params = @valid_params_with_sensor_id
      params[:end_time] = DateTime.now
      get 'index', params
      expect(response.status).to eq(200)
      expect(JSON.parse(response.body)["data"].length).to eq(22)
    end

    it 'should return all data only with end_time & start_time' do
      params = @valid_params_with_sensor_id
      params[:start_time] = DateTime.now - 100.years
      params[:end_time] = DateTime.now
      get 'index', params
      expect(response.status).to eq(200)
      expect(JSON.parse(response.body)["data"].length).to eq(22)
    end

